import { imageURL } from "../../constants data/data";
import { Grid, styled } from '@mui/material';

const Wrapper = styled(Grid)

const MidBannerSection = () => {
    return (
        <Grid lg={12} sm={12} md={12} xs={12} container>
            {
                imageURL.map(image => (
                    <Grid item lg={4} md={4} sm={12} xs={12}>
                    <img src={image} alt="Ads-Banner"  style={{ width: '100%'}} />
                    </Grid>
                ))
            }
        </Grid>

    )
}
export default MidBannerSection;
